function DeleteEntity(n,t){n!=null&&sweetAlert.confirm({showCancelButton:!0},function(i){i&&$.ajax({url:`${t}/Delete/${n}`,type:"GET",success:function(t){var i=t,r;console.log("response",i);i.responseCode==CODES.RESPONSE_CODE_OK?(sweetAlert.success({title:"Deleted!",text:i.responseMessage}),$("table#main-table tr#main-table-row-"+n).remove(),r=parseInt($(".main-count").html())-1,$(".main-count").html(r)):i.errorCode==CODES.RESPONSE_CODE_ERROR?sweetAlert.error({text:i.errorMessage}):i.responseCode==CODES.RESPONSE_CODE_NOTFOUND&&sweetAlert.error({text:i.responseMessage})},error:function(n){console.log(n);sweetAlert.error({text:`An error Occured while deleting.`})}})})}